import React from 'react';
import Editor from './editor';
import { withRouter } from 'react-router-dom'

class AddPost extends React.Component {
    render(){
        return(
           <div>
                <h1> Post </h1><br/>
                <Editor {...this.props} />
            </div>
        )
}
}

export default withRouter(AddPost);
